import React from 'react';
import './ContactInfo.css';

export const ContactInfo = () => {
  return (
  <div className="inc-exp-container">
  <div className="phone">
    <h4 >Phone: (519)-991-2096 </h4>
  </div>
  <div className="email">
    <h4 >Email: guohao.ouyang@gmail.com</h4>
  </div>
  </div>
  )
}
